import Container from "react-bootstrap/Container";
import Nav from "react-bootstrap/Nav";
import Navbar from "react-bootstrap/Navbar";
/*
import navIcon1 from "../../assets/img/nav-icon1.svg";
import navIcon2 from "../../assets/img/nav-icon2.svg";
import navIcon3 from "../../assets/img/nav-icon3.svg"; */
import navIcon1 from "../assets/img/nav-icon1.svg";
import navIcon2 from "../assets/img/nav-icon2.svg";
import navIcon3 from "../assets/img/nav-icon3.svg";
import navIcon4 from "../assets/img/email-svgrepo-com.svg";
function ColorSchemesExample() {
  return (
    <>
      <Navbar
        bg="dark"
        data-bs-theme="light"
        className="dimensionnav text-light"
      >
        <Container>
          <Navbar.Brand className="lead-text text-light " href="#home">
            Leonardo Antonelli
          </Navbar.Brand>
          <Nav className="me-auto">
            <Nav.Link href="#home" className="text-secondary">
              Skills
            </Nav.Link>
            <Nav.Link href="#features" className="text-secondary">
              Projects
            </Nav.Link>
            <Nav.Link href="#pricing" className="text-secondary">
              Contact
            </Nav.Link>
            <div className="social-icon">
              <a href="#">
                <img src={navIcon1} alt="" />
              </a>
              <a href="#">
                <img src={navIcon2} alt="" />
              </a>
              <a href="#">
                <img src={navIcon3} alt="" />
              </a>
            </div>
          </Nav>
        </Container>
      </Navbar>
    </>
  );
}

export default ColorSchemesExample;
